import { include } from 'named-urls';
import { faObjectGroup, faBuilding } from '@fortawesome/free-regular-svg-icons';
import {
  faUsers,
  faShapes,
  faChartLine
} from '@fortawesome/free-solid-svg-icons';

const userSessionCookie = 'upayogakarta';
const rememberUserCookie = 'yaadrakhna';

const FOOTPRINTS_ROUTES = {
  LOGIN: '/login/',
  USERS: '/users/',
  ORG_UNITS: '/org-units/',
  ANALYTICS: '/analytics/',
  DASHBOARD: '/dashboard/',

  ASSET_TYPES: include('/asset-types/', {
    LIST: '',
    ADD: 'add/',
    DETAIL: include(':assetTypeId/', {
      SHOW: '',
      MODIFY: 'modify/'
    })
  }),

  FORGOT_PASSWORD: '/forgot-password',
  PASSWORD_RESET: '/password-reset/:token'
};

const SIDENAV_ITEMS = [
  {
    position: 1,
    displayName: 'Analytics',
    route: FOOTPRINTS_ROUTES.ANALYTICS,
    icon: faChartLine
  },
  {
    position: 2,
    displayName: 'Org Units',
    route: FOOTPRINTS_ROUTES.ORG_UNITS,
    icon: faBuilding
  },
  {
    position: 3,
    displayName: 'Users',
    route: FOOTPRINTS_ROUTES.USERS,
    icon: faUsers
  },
  {
    position: 4,
    displayName: 'Asset Types',
    route: FOOTPRINTS_ROUTES.ASSET_TYPES.LIST,
    icon: faObjectGroup
  },
  {
    position: 5,
    displayName: 'Asset Attributes',
    route: FOOTPRINTS_ROUTES.ASSET_TYPES.ADD,
    icon: faShapes
  }
];

export {
  userSessionCookie,
  rememberUserCookie,
  FOOTPRINTS_ROUTES,
  SIDENAV_ITEMS
};
